 Для создания функции в Swift, которая сортирует массив целых чисел и выводит его на экран, мы сначала создадим функцию, которая будет сортировать массив. Затем мы вызовем эту функцию и выведем результат на экран. Вот пример такой функции:

```swift
import Foundation

func sortAndPrintArray(of numbers: [Int]) {
    // Сортируем массив
    let sortedNumbers = numbers.sorted()

    // Выводим отсортированный массив
    for number in sortedNumbers {
        print(number)
    }
}

// Пример использования функции
let unsortedNumbers = [5, 3, 8, 4, 1, 6]
sortAndPrintArray(of: unsortedNumbers)
```

В этом примере:
1. Функция `sortAndPrintArray(of:)` принимает массив целых чисел `numbers`.
2. Она сортирует этот массив с помощью метода `sorted()`, который возвращает новый массив, содержащий элементы в отсортированном порядке.
3. Затем функция перебирает элементы отсортированного массива с помощью цикла `for-in` и выводит каждый элемент на экран с помощью метода `print()`.
4. В примере используется пример массива `unsortedNumbers`, который затем отсортирован и выведен на экран.

Этот код можно скопировать и вставить в Xcode или другой интегрированной среде разработки Swift, чтобы протестировать его работу.

 Aquí tienes un ejemplo de código en C++ para el ESP32 que lee las temperaturas de sensores 1-Wire DS18B20 y las muestra en el monitor serial. Asegúrate de que tus sensores estén correctamente conectados a los pines del ESP32 y que el bus 1-Wire esté correctamente configurado.

```cpp
#include <OneWire.h>
#include <DallasTemperature.h>

#define ONE_WIRE_BUS 21 // Reemplaza 21 con el número de pin que estés usando para el bus 1-Wire

OneWire oneWire(ONE_WIRE_BUS); // Instancia de OneWire
DallasTemperature sensors(&oneWire); // Instancia de DallasTemperature

void setup() {
  Serial.begin(115200); // Inicia el monitor serial en 115200 baudios
  sensors.begin(); // Inicia la lectura de sensores DS18B20
}

void loop() {
  sensors.requestTemperatures(); // Solicita las temperaturas de todos los sensores
  float fahrenheit = sensors.getTempFByIndex(0); // Obtiene la temperatura en grados Fahrenheit del primer sensor
  float celsius = sensors.getTempCByIndex(0); // Obtiene la temperatura en grados Celsius del primer sensor

  // Muestra las temperaturas en el monitor serial
  Serial.print("Temperatura en grados Fahrenheit: ");
  Serial.print(fahrenheit);
  Serial.print(" Temperatura en grados Celsius: ");
  Serial.println(celsius);

  delay(1000); // Espera 1 segundo antes de leer de nuevo
}
```

Este código asume que tienes un solo sensor conectado y deseas leer su temperatura. Si tienes más sensores, simplemente cambia el índice en `getTempFByIndex` y `getTempCByIndex` para seleccionar el sensor deseado.

Ten en cuenta que este código utiliza la librería `OneWire` para comunicarse con los sensores 1-Wire y la librería `DallasTemperature` para facilitar la lectura de temperaturas. Asegúrate de que las librerías estén correctamente instaladas en tu entorno de desarrollo.

 Aquí tienes el algoritmo Bubble Sort implementado en C:

```c
#include <stdio.h>

void bubbleSort(int arr[], int n) {
    int i, j, temp;
    for (i = 0; i < n-1; i++) {
        for (j = 0; j < n-i-1; j++) {
            if (arr[j] > arr[j+1]) {
                // Intercambiar los elementos si el primero es mayor que el segundo
                temp = arr[j];
                arr[j] = arr[j+1];
                arr[j+1] = temp;
            }
        }
    }
}

void imprimirArray(int arr[], int n) {
    int i;
    for (i=0; i < n; i++)
        printf("%d ", arr[i]);
    printf("\n");
}

int main() {
    int arr[] = {64, 34, 25, 12, 22, 11, 90};
    int n = sizeof(arr)/sizeof(arr[0]);
    bubbleSort(arr, n);
    printf("Arreglo ordenado:\n");
    imprimirArray(arr, n);
    return 0;
}
```

Este programa define una función `bubbleSort` que ordena un arreglo de enteros utilizando el algoritmo de ordenamiento por inserción. La función `imprimirArray` se utiliza para imprimir el arreglo ordenado. En el `main` se crea un arreglo de ejemplo y se ordena utilizando la función `bubbleSort`.

