 Claro, en Java, un "if" es una estructura de control que permite que el flujo del programa siga diferentes caminos dependiendo de si una condición específica se cumple o no. La estructura básica de un "if" en Java es la siguiente:

```java
if (condición) {
    // Código a ejecutar si la condición es verdadera
}
```

La condición que se evalúa dentro del paréntesis debe ser un valor booleano, es decir, solo puede ser verdadero (`true`) o falso (`false`). Si la condición es verdadera, el código dentro del bloque `{}` entre en acción. Si la condición es falsa, el código dentro del bloque no se ejecuta.

Aquí hay un ejemplo más detallado:

```java
int numero = 10;

if (numero > 5) {
    System.out.println("El número es mayor que 5");
}
```

En este ejemplo, la condición `numero > 5` se evalúa como verdadera, ya que el valor de `numero` es 10, que es mayor que 5. Por lo tanto, el mensaje "El número es mayor que 5" se imprimirá en la consola.

También puedes anidar "if" dentro de "if" para manejar múltiples condiciones y acciones. Aquí hay un ejemplo:

```java
int numero = 10;

if (numero > 5) {
    System.out.println("El número es mayor que 5");
} else {
    System.out.println("El número es menor o igual que 5");
}
```

En este caso, la condición `numero > 5` se evalúa como verdadera, por lo que se imprime el primer mensaje. Si la condición hubiera sido falsa, se habría ejecutado el bloque de código dentro del `else`, que muestra el segundo mensaje.

 Here is a JavaScript function that checks if an array of 5 numbers contains a prime number. If a prime number is found, it prints the number to the console.

```javascript
function isPrime(num) {
    if (num < 2) return false;
    for (let i = 2; i <= Math.sqrt(num); i++) {
        if (num % i === 0) return false;
    }
    return true;
}

function findPrimeInArray(arr) {
    for (let i = 0; i < arr.length; i++) {
        if (isPrime(arr[i])) {
            console.log(arr[i]);
            return;
        }
    }
}

let arr = [1, 2, 3, 4, 5];
findPrimeInArray(arr);
```

In this code, `isPrime` function checks if a number is prime or not. It returns `false` if the number is less than 2 or if it's divisible by any number up to its square root.

`findPrimeInArray` function iterates over the array and checks each number if it's prime using `isPrime` function. If a prime number is found, it logs the number to the console and stops further execution.

