 En Java, puedes crear un bucle `for` de la siguiente manera:

```java
for (int i = 0; i < 10; i++) {
    // Aquí va el código que se ejecutará en cada iteración del bucle
    System.out.println("Iteración número " + i);
}
```

En este ejemplo, el bucle `for` itera 10 veces, comenzando desde 0 e incrementando el valor de `i` en 1 en cada iteración. Puedes cambiar el número en el paréntesis de la condición para controlar cuántas veces se ejecutará el bucle.

Además, también puedes utilizar un bucle `for` que itera sobre un array o una colección de objetos, como un ArrayList. Por ejemplo:

```java
String[] nombres = {"Juan", "María", "Carlos", "Ana", "Pepe"};

for (String nombre : nombres) {
    System.out.println(nombre);
}
```

En este ejemplo, el bucle `for` itera sobre cada elemento del array `nombres` e imprime cada uno de ellos en la consola.
